func TestDay5Part1(t *testing.T) {
	stablePolymerCounter := func(input string) int {
		lastInput := input
		currentlyBeingBuiltInput := ""
		matches := false
		for !matches {
			for i := 0; i < len(lastInput)-1; i++ {
				rune1 := rune(lastInput[i])
				rune2 := rune(lastInput[i+1])
				//				fmt.Printf("Testing %s to %s\n", string(rune1), string(rune2))
				if (unicode.IsUpper(rune1) && unicode.IsLower(rune2)) || (unicode.IsLower(rune1) && unicode.IsUpper(rune2)) {
					if unicode.ToUpper(rune1) == unicode.ToUpper(rune2) {
						currentlyBeingBuiltInput = fmt.Sprintf("%s%s", lastInput[:i], lastInput[i+2:])
						break
					}
				}
			}
			if lastInput == currentlyBeingBuiltInput {
				matches = true
			} else {
				lastInput = currentlyBeingBuiltInput
			}
		}

		return len(currentlyBeingBuiltInput)
	}

	testInput := `dabAcCaCBAcCcaDA`
	assert.Equal(t, 10, stablePolymerCounter(testInput))
	assert.Equal(t, 10132, stablePolymerCounter(day5Input))
}

func TestDay5Part2(t *testing.T) {
	stablePolymerCounter := func(input string) int {
		lastInput := input
		currentlyBeingBuiltInput := ""
		matches := false
		for !matches {
			for i := 0; i < len(lastInput)-1; i++ {
				rune1 := rune(lastInput[i])
				rune2 := rune(lastInput[i+1])
				if (unicode.IsUpper(rune1) && unicode.IsLower(rune2)) || (unicode.IsLower(rune1) && unicode.IsUpper(rune2)) {
					if unicode.ToUpper(rune1) == unicode.ToUpper(rune2) {
						currentlyBeingBuiltInput = fmt.Sprintf("%s%s", lastInput[:i], lastInput[i+2:])
						break
					}
				}
			}
			if lastInput == currentlyBeingBuiltInput {
				matches = true
			} else {
				lastInput = currentlyBeingBuiltInput
			}
		}

		return len(currentlyBeingBuiltInput)
	}

	reductionMapper := func(input string) (string, int) {

		inputMap := make(map[rune]int)
		for _, char := range input {
			inputMap[unicode.ToUpper(char)] = 1
		}
		bestString := ""
		bestCount := len(input)
		for repalceableElement, _ := range inputMap {
			replacedString := strings.Map(func(r rune) rune {
				switch r {
				case repalceableElement:
					return -1
				case unicode.ToLower(repalceableElement):
					return -1
				}
				return r
			}, input)
			yield := stablePolymerCounter(replacedString)
			if yield < bestCount {
				bestCount = yield
				bestString = string(repalceableElement)
			}
		}
		return bestString, bestCount
	}
	testInput := `dabAcCaCBAcCcaDA`
	testString, testYield := reductionMapper(testInput)
	assert.Equal(t, "C", testString)
	assert.Equal(t, 4, testYield)
	puzzleString, puzzleYield := reductionMapper(day5Input)
	assert.Equal(t, "M", puzzleString)
	assert.Equal(t, 4572, puzzleYield)

}

